// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

/**
 * @title Storage
 * @dev Store & retrieve value in a variable
 */
contract ClaimERC20 {

    mapping(address => uint) public unclaimed;
    mapping(address => uint) public claimed;

    /**
     * @dev Store value in address mapped with unclaimed amounts
     * @param _account account to store value
     * @param _amt amount to add to unclaimed
     */
    function setUnclaimed(address _account, uint256 _amt) internal {
        unclaimed[_account] += _amt;
    }

    /**
     * @dev Return value in address mapped with unclaimed amounts
     * @param _account account with value stored
     */
    function getUnclaimed(address _account) public view returns (uint256) {
        return unclaimed[_account];
    }

    /**
     * @dev Store value in address mapped with claimed amounts
     * @param _account account to store value
     * @param _amt amount to add to claimed
     */
    function setClaimed(address _account, uint256 _amt) internal {
        claimed[_account] += _amt;
    }

    /**
     * @dev Return value in address mapped with claimed amounts
     * @param _account account with value stored
     */
    function getClaimed(address _account) public view returns (uint256) {
        return claimed[_account];
    }

    /**
     * @dev Store value in address mapped with unclaimed amounts using virtual amount (offchain value)
     * @param _account account with value stored
     * @param _amount value from offchain
     */
    function createClaimable(address _account, uint256 _amount) external {
        uint256 _unclaimed = _amount - claimed[_account] - unclaimed[_account];
        require(_unclaimed > 0, 'claimable must be greater than 0');
        setUnclaimed(_account, _unclaimed);
    }
}

